10.body:
Transactions are a way to run a logic on a blockchain, which in blockchains with smart contracts means to call contracts. There are different ways to do this, but to make things as flexible as possible, little assumptions are made about what transaction actually looks like. There are many use cases that should be supported, it is tough to foresee them all. Since as mentioned in Contract overview ‚Äú Everything is a contract ,‚Äù then the majority of transaction processing must be done by a contract too. To do this, the contract must implement the following ‚Äútransaction handler‚Äù interface that looks like this (simplified for readability): pub struct TransactionHeader { pub block_hash: Blake3Hash, pub gas_limit: Gas, pub contract: Address,
} pub struct TransactionSlot { pub owner: Address, pub contract: Address,
} pub type TxHandlerPayload = [u128];
pub type TxHandlerSlots = [TransactionSlot];
pub type TxHandlerSeal = [u8]; #[contract]
pub trait TxHandler { /// Verify a transaction #[view] fn authorize( #[env] env: &Env, #[input] header: &TransactionHeader, #[input] read_slots: &TxHandlerSlots, #[input] write_slots: &TxHandlerSlots, #[input] payload: &TxHandlerPayload, #[input] seal: &TxHandlerSeal, ) -> Result<(), ContractError>; /// Execute previously verified transaction #[update] fn execute( #[env] env: &mut Env, #[input] header: &TransactionHeader, #[input] read_slots: &TxHandlerSlots, #[input] write_slots: &TxHandlerSlots, #[input] payload: &TxHandlerPayload, #[input] seal: &TxHandlerSeal, ) -> Result<(), ContractError>;
} High-level transaction processing workflow: TxHandler::authorize()Charge gasTxHandler::execute()Refund gas TxHandler::authorize() is a method to be called by execution environment that must, in a limited amount of time, either authorize further processing of the transaction or reject it. It can read the state of the blockchain, but can‚Äôt modify it. If authorized successfully, execution environment will charge TransactionHeader.gas_limit gas, call TxHandler::execute() and return unused gas afterward. It is up to the node to decide how much compute to allow in authorization, but some reasonable for reference hardware default will be used to allow for typical signature verification needs. Compute involved in transaction authorization will be added to the total gas usage. seal is where the signature will typically be stored, although it is more of a convention a strict requirement. TxHandler::execute() is responsible for transaction execution, meaning making method calls. Method calls by convention are serialized into payload (u128 is used to ensure its alignment in memory for performance reasons and to enable zero-copy throughout the system). It is up to the contract how it wants to encode method calls there, though optimized reference implementation of this is provided. While typically not needed, authorization code may also inspect payload to, for example, only allow certain method calls and not others. This separation should be enough to build all kinds of contracts that would server as a ‚Äúwallet‚Äù for the user: from those that do simple signature verification, to complex multisig wallet with a sophisticated role-based permission system. There is a large space of tradeoffs to explore. read_slots and write_slots contain the list of slots (see Storage model ), which will be read or possibly modified during transaction execution. They will not need to be inspected by most contracts in detail, though can be used constrain interation with a limited set of contracts if needed. This information is crucial for to be able to schedule concurrent execution of non-conflicting transactions, leveraging the fact that modern CPUs have multiple cores. This is primarily enabled by the storage model that makes the storage used by contracts well suited for concurrent execution by avoiding data structures like global hashmaps that are likely to be updated by multiple transactions in a block.

