A transaction submitted to the network will include not only inputs to the method calls, the storage items (code, state, other slots) required for the transaction to be processed alongside corresponding storage proofs. This allows for consensus nodes to not store state of contracts beyond a small root, yet being able to process incoming transactions, leading to much lower disk requirements. This is especially true in the presence of dormant contracts without any activity for a long period of time and generally removes the need to charge ‚Äúrent‚Äù for the state. It is, of course, possible for node to have a cache to reduce or remove the need to download frequently used storage items. Each method call of the contract has metadata associated with it about what slots will be read or modified alongside any inputs or outputs it expects and their type information. With this information and read_slots/write_slots included in the transaction, execution engine can run non-conflicting transactions in parallel. For example, balance transfer between two accounts doesn‚Äôt change the total issuance of the token. So there is no need to change the global state of the token contract and no reason why such transfers affecting a disjoint set of accounts can‚Äôt be run in parallel. Not only that, storage items used in each method call follow a Rust-like ownership model where contract can‚Äôt recursively call its own method that mutates already accessed slots because it‚Äôll violate safety invariants. Recursive calls of stateless or read-only methods are fine though. The right mental model is that storage access can be used with shared & or exclusive &mut references. It is possible to have multiple shared references to the same slot at the same time. For exclusive access in a recursive call to the slot already being accessed, caller must share it as an input instead, explicitly giving borrowing the data. As a result, multiple calls (in the same transaction or even different transaction) can read the same slot concurrently, but only one of them is allowed to mutate a particular storage item at a time. And any violation aborts the corresponding method, which caller can observe and either handle or propagate further up the stack. This makes traditional reentrancy attacks impossible in such execution environment. Conceptually in pseudocode with RwLock it looks something like this: fn entrypoint(data: &RwLock<Data>) -> Result<(), Error> { // This is the first write access, it succeeds let data_write_guard = data.try_write()?; // This will fail because we still have write access to the data if call_into_other_contract(data).is_err() { // This is okay, the data was given as an explicit argument modify_data(data_write_guard); } Ok(())
} fn call_into_other_contract(data: &RwLock<Data>) -> Result<(), Error> { // Only succeeds if there isn't already write access elsewhere data.try_read()?; Ok(())
} fn modify_data(data: &mut Data) {} Here is a visual example: No state (Contract 1)Mutates own state (Contract 2)Reads state (Contract 3)fn compute(...)fn update(&amp;mut self, ...)fn read(&amp;self, ...) ‚úÖ‚úÖ‚ùå‚úÖ‚úÖ Such a loop will be caught and the transaction will be aborted: Mutates own state (Contract 1)Reads state (Contract 2)fn update(&amp;mut self, ...)fn read(&amp;self, ...) ‚úÖStart‚ùå

