All storage owned by a contract is organized into a container that has slots inside. It forms a tree with the root being the root of contract‚Äôs storage, which can be used to generation inclusion/exclusion proofs when processing transactions (see Transaction processing ). Having a per-contract tree with storage proofs allows consensus nodes to not be required to store the state of all contracts, just their storage roots. This is unlike many other blockchains where contract may have access to a form of key-value database. Each slot is managed by exactly one of the existing contracts and can only be read or modified by that contract. Contract‚Äôs code and state are also slots managed by contracts (system contracts), even though developer-facing API might abstract it in a more friendly way. It is possible for a contract to manage one of its slots too, like when a token contract owns some number of its own tokens. A bit wrong, but hopefully useful analogy is cloud server. A server is owned by a provider, but managed by a customer. A provider typically doesn‚Äôt have remote access to the server customer orders, all changes to the software that server runs are done by the customer. Similarly, slots owned by a contract are managed by other contracts. In contrast to most other blockchains by ‚Äústate‚Äù we refer to the inherent state of the contract itself, rather than things that might belong to end-users. The right mental model is to think of it as a global state of a contract. Let‚Äôs take a generic fungible token as an example. System state contract will manage its state, stored in corresponding slot owned by the token contract. State will contain things like total supply and potentially useful metadata like number of decimal places and ticker, but not balances of individual users. In pseudocode, more traditional blockchains: fancy_token = { // Global state totalSupply: 50_000, ticker: "FANCY", // Individual balances of accoutns in a global hashmap balances: { alice_wallet: 10, bob_wallet: 15, },
} Described storage model with slots: fancy_token = { // Global state owned by `fancy_token` in a slot managed by `state` contract state: { totalSupply: 50_000, ticker: "FANCY", }, code: "...",
} alice_wallet = { // Balance owned by `alice_wallet` in a slot managed by `fancy_token` contract fancy_token: { balance: 10, }, code: "...",
} bob_wallet = { // Balance owned by `bob_wallet` in a slot managed by `fancy_token` contract fancy_token: { balance: 15, }, code: "...",
} The state of the contract (and any other slot) is typically bounded in size and defined by contract developer upfront. Bounded size allows execution environment to allocate the necessary amount of memory and to limit the amount of data that potentially needs to be sent with the transaction over the network (see Transaction processing ). This implies there can‚Äôt be more traditional unbounded hashmap there. Instead, balances are stored in slots of contracts that own the balance (like smart wallet owned by end user), but managed by the token contract. This is similar to how contract‚Äôs state and code are managed by corresponding system contracts. Visually, it looks something like this: WalletCode contractState contractToken contractStateBalanceCodeCodeCodeStateCode Contracts do not have access to underlying storage implementation in the form of key-value database, instead they modify slots as the only way of persisting data between transactions.

