Not only contract methods do not have access to general purpose key-value store (even if private to the contract), they don‚Äôt have access to any other data except what was explicitly provided as method input. They also can‚Äôt return data in any other way except through return arguments. Execution environment will pre-allocate memory for all slots/outputs and provide it to the method to work with, removing a need for heap allocation in many cases. One can think about contract logic as a pure function: it takes inputs and slots, potentially modifies slots and returns outputs. Conceptually, all methods look something like this: #[contract]
impl MyContract { /// Stateless compute #[view] pub fn add( #[input] &a: &u32, #[input] &b: &u32, ) -> u32 { a + b } /// Calling another contract (in this case into itself) #[view] pub fn add_through_contract_call( #[env] env: &Env, #[input] &a: &u32, #[input] &b: &u32, ) -> Result<u32, ContractError> { env.my_contract_add(env.own_address(), a, b) } /// Modifying its own state using the contents of the slot #[update] pub fn self_increment_by_slot( &mut self, #[slot] slot: &MaybeData<u32>, ) -> Result<u32, ContractError> { let old_value = self.value; // The slot may or may not exist yet let Some(slot_value) = slot.get().copied() else { return Err(ContractError::Forbidden); }; self.value = old_value .checked_add(slot_value) .ok_or(ContractError::BadInput)?; Ok(old_value) }
} Environment handle (&Env or &mut Env) allows calling other contracts and request ephemeral state, contract slots can be read and written to, inputs are read-only and outputs are write-only. & or &mut in Rust limits what can be done with these types, there is no other implicit ‚Äúglobal‚Äù way to read or update ephemeral or permanent state of the blockchain except through these explicit arguments. Handling everything through explicit inputs and outputs results in straightforward implementation, analysis and testing approach without side effects. In many cases, even heap allocations can be avoided completely, leading to fast and compact smart contract implementation. #[contract] macro and attributes like #[env] do not impact the code in a method in any way, but help to generate additional helper data structures, functions and metadata about the contract. The macro also verifies a lot of different invariants about the contract with helpful compile-time error messages if something goes wrong. For example, when different methods use different types for #[slot] argument or when type not allowed for FFI is used in an argument.
